import Posts from "../../components/Posts/Posts"
import Share from "../../components/Share/Share"
import "./Home.scss"
import { useLocation } from "react-router-dom"

const Home = () => {
     const userId = parseInt(useLocation().pathname.split("/")[2]);
    return (
        <div className="Home">
            <Share />
            <Posts userId={userId}/>
        </div>
    )
}

export default Home
